import { baseURL } from "./OpenAI";
import { useEffect, useState } from "react";
import axios from "axios";

function GetPetNames(props)  {
    const petNames = useState([]);
    useEffect(() => {
        axios
            .post(baseURL+"nlp-pet-name/specie/"+props.specie)
            .then(res => {
                const petNamesRes = res.data;
                this.setPetNames(petNamesRes);
                this.specie = props.specie;
            })
            .catch(err => {
                console.log(err);
            });
    }, []);
}

export {GetPetNames}
